            __html: '<p>这里是JsonTsai的个人网站</p>\n<h2 id="%E8%87%AA%E6%88%91%E4%BB%8B%E7%BB%8D">自我介绍<a class="anchor" href="#%E8%87%AA%E6%88%91%E4%BB%8B%E7%BB%8D">§</a></h2>\n<ul>\n<li>一名00后前端小白</li>\n<li>三年学术项目</li>\n<li>四年班级干部</li>\n<li>一年实习经历</li>\n</ul>\n<h2 id="%E6%8A%80%E6%9C%AF%E7%A7%AF%E7%B4%AF">技术积累<a class="anchor" href="#%E6%8A%80%E6%9C%AF%E7%A7%AF%E7%B4%AF">§</a></h2>\n<p>CSDN:</p>\n<pre class="language-autoit"><code class="language-autoit">https<span class="token punctuation">:</span><span class="token operator">/</span><span class="token operator">/</span>blog<span class="token punctuation">.</span>csdn<span class="token punctuation">.</span>net<span class="token operator">/</span>m0_46983722\n</code></pre>\n<p>GitHub：</p>\n<pre class="language-autoit"><code class="language-autoit">https<span class="token punctuation">:</span><span class="token operator">/</span><span class="token operator">/</span>github<span class="token punctuation">.</span>com<span class="token operator">/</span>JieHaoCai\n</code></pre>\n<p>Gitee：</p>\n<pre class="language-autoit"><code class="language-autoit">Gitee：https<span class="token punctuation">:</span><span class="token operator">/</span><span class="token operator">/</span>gitee<span class="token punctuation">.</span>com<span class="token operator">/</span>JacksonTsai\n</code></pre>\n<h2 id="%E6%8A%80%E6%9C%AF%E6%A0%88">技术栈<a class="anchor" href="#%E6%8A%80%E6%9C%AF%E6%A0%88">§</a></h2>\n<h3 id="%E5%89%8D%E7%AB%AF">前端<a class="anchor" href="#%E5%89%8D%E7%AB%AF">§</a></h3>\n<ul>\n<li>Vue2、Vue3</li>\n<li>React</li>\n<li>Uniapp</li>\n</ul>\n<h3 id="%E5%90%8E%E7%AB%AF">后端<a class="anchor" href="#%E5%90%8E%E7%AB%AF">§</a></h3>\n<ul>\n<li>JAVA web</li>\n<li>Spring-Boot、SSM</li>\n</ul>\n<h3 id="%E5%85%B6%E4%BB%96">其他<a class="anchor" href="#%E5%85%B6%E4%BB%96">§</a></h3>\n<p>docker、Go、Python、C、C++</p>\n<h2 id="%E7%BB%84%E4%BB%B6%E5%BA%93">组件库<a class="anchor" href="#%E7%BB%84%E4%BB%B6%E5%BA%93">§</a></h2>\n<ul>\n<li>elementUI+plus</li>\n<li>uview</li>\n<li>vant</li>\n<li>Adegsin</li>\n<li>Taro</li>\n<li>WeUI</li>\n</ul>\n<h3 id="%E5%89%8D%E7%AB%AF%E5%B0%8F%E7%99%BD">前端小白<a class="anchor" href="#%E5%89%8D%E7%AB%AF%E5%B0%8F%E7%99%BD">§</a></h3>\n<p>工作的时候，上司把我比作一块海绵，一刻不停的在吸水，怎么吸收都不满足。我对待技术也是如此，虽然前端的技术实在繁多，但是每天都要像海绵一样不断的吸水，保持一名小白的热情！</p>\n<h3 id="%E4%B8%89%E5%B9%B4%E5%AD%A6%E6%9C%AF%E9%A1%B9%E7%9B%AE">三年学术项目<a class="anchor" href="#%E4%B8%89%E5%B9%B4%E5%AD%A6%E6%9C%AF%E9%A1%B9%E7%9B%AE">§</a></h3>\n<p>我从大一下半年就开始从事学校的创业学术项目，不仅是为了学院奖学金以及奖项，更是为了未来技术的积累和帮助，事实证明，这三年的学术经历对我的成长和工作的帮助是巨大的！</p>\n<h3 id="%E5%9B%9B%E5%B9%B4%E7%8F%AD%E7%BA%A7%E5%B9%B2%E9%83%A8">四年班级干部<a class="anchor" href="#%E5%9B%9B%E5%B9%B4%E7%8F%AD%E7%BA%A7%E5%B9%B2%E9%83%A8">§</a></h3>\n<p>我当过一年的团支书和三年的班长，尽管由于项目的繁多可能没办法照顾到班级的每个人，但是四年的班级干部我问心无愧，我做到了我应该做到的！</p>\n<p>作为班级干部，可能没办法被所有人都认可，但是你只要尽全力去做的，犯错误勇于承担错误，荣辱与共。大学是一个小型社会，如果你适应了，那么到了社会大家庭，你也不用害怕！</p>\n<h3 id="%E5%AE%9E%E4%B9%A0%E7%BB%8F%E5%8E%86">实习经历<a class="anchor" href="#%E5%AE%9E%E4%B9%A0%E7%BB%8F%E5%8E%86">§</a></h3>\n<p>大三下半年就开始实习了，很感谢现在的公司，愿意给我机会去发挥自己的能力！</p>\n<ol>\n<li>淘友小栈</li>\n<li>游戏福利小程序</li>\n<li>广告投放系统</li>\n<li>iOS应用—来信</li>\n</ol>\n<h4 id="%E6%B7%98%E5%8F%8B%E5%B0%8F%E6%A0%88">淘友小栈<a class="anchor" href="#%E6%B7%98%E5%8F%8B%E5%B0%8F%E6%A0%88">§</a></h4>\n<p>该网站是一个虚拟游戏商品交易平台</p>\n<p>淘游小栈（客户端和管理端），项目从零到一独立完成，目前已商用</p>\n<h5 id="%E9%93%BE%E6%8E%A5%E5%9C%B0%E5%9D%80">链接地址<a class="anchor" href="#%E9%93%BE%E6%8E%A5%E5%9C%B0%E5%9D%80">§</a></h5>\n<pre class="language-autoit"><code class="language-autoit">http<span class="token punctuation">:</span><span class="token operator">/</span><span class="token operator">/</span>h5<span class="token punctuation">.</span>trader<span class="token punctuation">.</span>cdk<span class="token punctuation">.</span>vip<span class="token operator">/</span><span class="token keyword">static</span><span class="token operator">-</span>u<span class="token operator">/</span>index<span class="token punctuation">.</span>html<span class="token operator">?</span>shopid<span class="token operator">=</span><span class="token number">20</span>\n</code></pre>\n<h5 id="%E6%8A%80%E6%9C%AF%E6%A0%88-1">技术栈<a class="anchor" href="#%E6%8A%80%E6%9C%AF%E6%A0%88-1">§</a></h5>\n<pre class="language-autoit"><code class="language-autoit">vue2<span class="token operator">+</span>uniapp<span class="token operator">+</span>uview\n</code></pre>\n<h5 id="%E6%8A%80%E6%9C%AF%E4%BA%AE%E7%82%B9">技术亮点<a class="anchor" href="#%E6%8A%80%E6%9C%AF%E4%BA%AE%E7%82%B9">§</a></h5>\n<pre class="language-autoit"><code class="language-autoit"><span class="token number">1</span>、商品生成自定义分享海报，可保存转发分享\n\n<span class="token number">2</span>、项目接入微信H5支付和微信JSAPI支付\n\n<span class="token number">3</span>、针对iOS的safari浏览器添加到桌面做不同显示效果\n\n<span class="token number">4</span>、实现图片直传阿里云OSS<span class="token punctuation">,</span>图片懒加载\n\n<span class="token number">5</span>、微信环境静默授权登录，h5环境验证码登录\n</code></pre>\n<h4 id="%E6%B8%B8%E6%88%8F%E7%A6%8F%E5%88%A9%E5%B0%8F%E7%A8%8B%E5%BA%8F">游戏福利小程序<a class="anchor" href="#%E6%B8%B8%E6%88%8F%E7%A6%8F%E5%88%A9%E5%B0%8F%E7%A8%8B%E5%BA%8F">§</a></h4>\n<p>该小程序主要是为了提高游戏用户黏度，构建微信公众号生态而作的福利小程序</p>\n<p>主要功能：转盘抽奖、用户管理、游戏虚拟道具售卖、秒杀类商品购买、游戏兑奖</p>\n<p>目前已商用：微信公众号搜索  <code>最强手游必玩</code></p>\n<h5 id="%E6%8A%80%E6%9C%AF%E6%A0%88-2">技术栈<a class="anchor" href="#%E6%8A%80%E6%9C%AF%E6%A0%88-2">§</a></h5>\n<pre class="language-autoit"><code class="language-autoit">vue2<span class="token operator">+</span>uniapp<span class="token operator">+</span>uview\n</code></pre>\n<h5 id="%E6%8A%80%E6%9C%AF%E4%BA%AE%E7%82%B9-1">技术亮点<a class="anchor" href="#%E6%8A%80%E6%9C%AF%E4%BA%AE%E7%82%B9-1">§</a></h5>\n<pre class="language-autoit"><code class="language-autoit"><span class="token number">1</span>、兼容多端发布\n\n<span class="token number">2</span>、项目接入微信H5支付和微信JSAPI支付\n\n<span class="token number">3</span>、配备路由守卫以及路由拦截\n</code></pre>\n<h4 id="ios%E5%BA%94%E7%94%A8%E6%9D%A5%E4%BF%A1">iOS应用—来信<a class="anchor" href="#ios%E5%BA%94%E7%94%A8%E6%9D%A5%E4%BF%A1">§</a></h4>\n<p>来信(iOS App)，项目从零到一独立完成，目前已上架苹果应用商店</p>\n<p>接收虚拟短信验证码</p>\n<h5 id="%E6%8A%80%E6%9C%AF%E4%BA%AE%E7%82%B9-2">技术亮点<a class="anchor" href="#%E6%8A%80%E6%9C%AF%E4%BA%AE%E7%82%B9-2">§</a></h5>\n<pre class="language-autoit"><code class="language-autoit"><span class="token number">1</span>、前端实现虚拟列表、虚拟分页、图片懒加载优化性能\n<span class="token number">2</span>、支持国际化，可切换中英文\n<span class="token number">3</span>、实现强制更新、提示更新提示跳转以及热更功能\n<span class="token number">4</span>、项目接入苹果内购支付\n</code></pre>\n<h4 id="%E5%B9%BF%E5%91%8A%E6%8A%95%E6%94%BE%E7%B3%BB%E7%BB%9F">广告投放系统<a class="anchor" href="#%E5%B9%BF%E5%91%8A%E6%8A%95%E6%94%BE%E7%B3%BB%E7%BB%9F">§</a></h4>\n<p>该平台是公司内部的广告投放系统，该系统对接快手MKT</p>\n<h5 id="%E6%8A%80%E6%9C%AF%E6%A0%88-3">技术栈<a class="anchor" href="#%E6%8A%80%E6%9C%AF%E6%A0%88-3">§</a></h5>\n<pre class="language-autoit"><code class="language-autoit">React18<span class="token operator">+</span>Redux<span class="token operator">+</span>React<span class="token operator">-</span>Router<span class="token operator">+</span>vite<span class="token operator">+</span>ad5\n</code></pre>\n<h5 id="%E6%8A%80%E6%9C%AF%E4%BA%AE%E7%82%B9-3">技术亮点<a class="anchor" href="#%E6%8A%80%E6%9C%AF%E4%BA%AE%E7%82%B9-3">§</a></h5>\n<pre class="language-autoit"><code class="language-autoit">实现对接快手MKT\n</code></pre>'
